import logo from './logo.svg';
import './App.css';

function Smth1(props){
  return <p>{props.cos}</p>;

}

function Smth2(props){
  return <p>{props.children}</p>;

}

function App() {
  const h = <h2>asd</h2>
  return (
      <Smth1 cos={h}>
      </Smth1>
  );
}

export default App;
